import * as React from 'react'
import { Button, Typography } from '@mui/material'

const QuizButton = ({buttonText}) => {
  return (
    <Button 
      variant="contained" 
      onClick={() => window.location.href = '/quiz'}
    >
      <Typography variant="h6">
          {text}
      </Typography>
    </Button>
  )
}

export default QuizButton
